    @Test
    @Transactional
    public void deleteCampione() throws Exception {
        // Initialize the database
        campioneService.save(campione);

        int databaseSizeBeforeDelete = campioneRepository.findAll().size();

        // Get the campione
        restCampioneMockMvc.perform(delete("/api/campiones/{id}", campione.getId())
                .accept(TestUtil.APPLICATION_JSON_UTF8))
                .andExpect(status().isOk());

        // Validate ElasticSearch is empty
        boolean campioneExistsInEs = campioneSearchRepository.exists(campione.getId());
        assertThat(campioneExistsInEs).isFalse();

        // Validate the database is empty
        List<Campione> campiones = campioneRepository.findAll();
        assertThat(campiones).hasSize(databaseSizeBeforeDelete - 1);
    }

